import React, { useState, useEffect } from 'react';
import './sdk.css';
import axios from 'axios';
import SdkComponent from './SdkComponent/sdkcomp'

const Sdk = (props) => {
    const { email } = props;
    const [sdkList, setSdkList] = useState([]);

    const getSdks = async () => {
        const response = await axios.post('http://localhost:3001/get-details', {
            email: email,
            project_type: 'SDK'
        });
        setSdkList(response.data);
    }

    useEffect(() => {
        getSdks();
    }, [email]);

    return (
        <div className='sdk-container'>
            <h1 className='sdk-heading'>Build with Beckn</h1>
            <br />
            <h2>
                Create a SDK<span className="plus-icon">+</span>
            </h2>
            <div className="sdk-projects">
                {sdkList.map(sdk => (
                    <SdkComponent key={sdk.id} data={sdk} />
                ))}
            </div>
        </div>
    );
};

export default Sdk;
